import React from 'react';

const Preset = ( { preset, setPreset }) => {

  return (
    <div>
      <button onClick={setPreset(preset.name)} style={{backgroundColor: `${preset.selected ? 'gray' : 'white'}`}}>
        {preset.name}
      </button>
    </div>
  )
}

export default Preset
